// Homepage.jsx
import React from "react";
import "./Homepage.css";

const Homepage = () => {
    // Sample data - Replace with your actual data
    const stats = {
        totalPosts: 15234,
        activeMembers: 5678,
        communities: 89
    };

    const topConfessions = [
        {
            id: 1,
            title: "My Greatest Secret",
            content: "I've been pretending to like coffee for 5 years just to fit in at work.",
            community: "Work Life",
            likes: 1520
        },
        // Add more confessions for the carousel
    ];

    const trendingConfessions = [
        {
            id: 1,
            title: "University Confession",
            content: "I accidentally submitted the wrong file for my final thesis...",
            likes: 456,
            comments: 89
        },
        // Add more trending confessions
    ];

    return (
        <div className="homepage">
            {/* Section 1: Top Confessions Carousel */}
            <section className="top-confessions-section">
                <h2>Top Confessions from Communities</h2>
                <div className="carousel-container">
                    <div id="topConfessionsCarousel" className="carousel slide" data-bs-ride="carousel">
                        <div className="carousel-inner">
                            <div className="carousel-item active">
                                <div className="confession-card">
                                    <h3>My Greatest Secret</h3>
                                    <p>I've been pretending to like coffee for 5 years just to fit in at work.</p>
                                    <div className="confession-meta">
                                        <span className="community">Work Life</span>
                                        <span className="likes">1.5k likes</span>
                                    </div>
                                </div>
                            </div>
                            {/* Add more carousel items */}
                        </div>
                    </div>
                </div>
            </section>

            {/* Section 2: Current Stats */}
            <section className="stats-section">
                <h2>Current Stats</h2>
                <div className="stats-container">
                    <div className="stat-card">
                        <i className="fas fa-file-alt"></i>
                        <h3>{stats.totalPosts.toLocaleString()}</h3>
                        <p>Total Posts</p>
                    </div>
                    <div className="stat-card">
                        <i className="fas fa-users"></i>
                        <h3>{stats.activeMembers.toLocaleString()}</h3>
                        <p>Active Members</p>
                    </div>
                    <div className="stat-card">
                        <i className="fas fa-building"></i>
                        <h3>{stats.communities}</h3>
                        <p>Communities</p>
                    </div>
                </div>
            </section>

            {/* Section 3: Trending */}
            <section className="trending-section">
                <h2>Trending Confessions</h2>
                <div className="confessions-grid">
                    {trendingConfessions.map(confession => (
                        <div key={confession.id} className="confession-card">
                            <h3>{confession.title}</h3>
                            <p>{confession.content}</p>
                            <div className="confession-meta">
                                <span>{confession.likes} likes</span>
                                <span>{confession.comments} comments</span>
                            </div>
                        </div>
                    ))}
                </div>
            </section>

            {/* Section 4: New */}
            <section className="new-section">
                <h2>New Confessions</h2>
                <div className="confessions-grid">
                    {/* Similar structure to trending section */}
                </div>
            </section>

            {/* Section 5: Popular */}
            <section className="popular-section">
                <h2>Popular Confessions</h2>
                <div className="confessions-grid">
                    {/* Similar structure to trending section */}
                </div>
            </section>
        </div>
    );
}

export default Homepage;
